import React from 'react';

const Stats = () => {
  return (
    <div className="flex justify-around items-center bg-gray-100 p-8 rounded-lg space-x-4">
      <div className="flex flex-col items-center text-center p-4 bg-white rounded-lg shadow">
        <span className="text-blue-500 text-4xl font-bold">10+</span>
        <span className="text-gray-500 text-lg">Year Experience</span>
      </div>
      <div className="flex flex-col items-center text-center p-4 bg-white rounded-lg shadow">
        <span className="text-blue-500 text-4xl font-bold">12K</span>
        <span className="text-gray-500 text-lg">Happy Clients</span>
      </div>
      <div className="flex flex-col items-center text-center p-4 bg-white rounded-lg shadow">
        <span className="text-blue-500 text-4xl font-bold">4.8</span>
        <span className="text-gray-500 text-lg">Overall Rating</span>
      </div>
    </div>
  );
};

export default Stats;
